import React from "react";
import { useLocation } from "react-router";

const Footer = () => {
  const location = useLocation();
  if (location.pathname !== "/") {
    return (
      <footer>
        <div className="text-center py-2 mt-auto">
          Copyright &copy; CAR RENTAL
        </div>
      </footer>
    );
  } else return null;
};

export default Footer;
